import React,{Component} from 'react';
import Home from './components/Home';
// import { BrowserRouter as Router,Route,Switch} from 'react-router-dom';
// import $ from 'jquery';


// window.jQuery = $;
// window.$ = $;
// global.jQuery = $;

class App extends Component {
    render(){
        return(
            <Router>
                <Switch>
                    <Route exact path="/" component={Home} />
                </Switch>
            </Router>
        )
    }
}

export default App;
